import React, { Component } from 'react'
import GridColumnSections from '../../GridColumnSections.js'

export default class HelpfulLinks extends GridColumnSections {
    sectionMap = new Map([
        ['QDuke','Presented by The Chronicle, this website contains links to all just about every website you could possibly want. Some of the more useful links for freshmen include ACES, Sakai, RateMyProfessor, and Schedulator.']
        ['Pratt Policies and Procedures','Like the name suggests, this site provides a comprehensive explanation of Pratt’s policies.'],
        ['E-Team','Here is a list of of all the current E-Teamers. Feel free to ask them any questions you might have.'],
        ['BME Degree Planning','Curriculum and Advising'],
        ['ECE Degree Planning','Curriculum and Advising'],
        ['ME Degree Planning','Curriculum and Advising'],
        ['CEE Degree Planning','Curriculum and Advising'],
    ]);

    constructor(){
        super()
        this.setMap(this.sectionMap);
        this.setColumnsPerRow(1);
      }
}
